import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import {
  Box,
  Typography,
  Table,
  TableHead,
  TableRow,
  TableCell,
  TableBody,
  CircularProgress,
  Paper,
} from '@mui/material';
import { getStudentTimesheetById } from '../services/adminService';
import Navbar from '../components/Navbar';
import { useAuth } from '../context/AuthContext';

function StudentTimesheetView() {
  const { id } = useParams();
  const { token } = useAuth();
  const [data, setData] = useState({ student: null, timesheets: [] });
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchTimesheet = async () => {
      try {
        const res = await getStudentTimesheetById(id, token);
        setData(res.data);
      } catch (err) {
        alert('โหลดข้อมูล Timesheet ไม่สำเร็จ');
      } finally {
        setLoading(false);
      }
    };
    fetchTimesheet();
  }, [id, token]);

  return (
    <>
      <Navbar />
      <Box
        sx={{
          minHeight: '100vh',
          backgroundColor: '#f4f6f8',
          p: 4,
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
        }}
      >
        <Box sx={{ width: '100%', maxWidth: 960 }}>
          <Typography
            variant="h5"
            gutterBottom
            sx={{ fontWeight: 'bold', textAlign: 'center', color: '#333' }}
          >
            ข้อมูล Timesheet
          </Typography>
          {data.student && (
            <Typography
              variant="subtitle1"
              gutterBottom
              sx={{ textAlign: 'center', mb: 3, color: '#666' }}
            >
              {data.student.fullName} ({data.student.studentId})
            </Typography>
          )}

          {loading ? (
            <Box sx={{ display: 'flex', justifyContent: 'center', mt: 4 }}>
              <CircularProgress />
            </Box>
          ) : data.timesheets.length === 0 ? (
            <Typography sx={{ textAlign: 'center', color: 'text.secondary' }}>
              ยังไม่มีข้อมูล Timesheet
            </Typography>
          ) : (
            <Paper elevation={2} sx={{ borderRadius: 2, overflowX: 'auto' }}>
              <Table>
                <TableHead>
                  <TableRow sx={{ backgroundColor: '#f5f5f5' }}>
                    <TableCell sx={{ fontWeight: 'bold' }}>วันที่</TableCell>
                    <TableCell sx={{ fontWeight: 'bold' }}>เวลาเข้า</TableCell>
                    <TableCell sx={{ fontWeight: 'bold' }}>เวลาออก</TableCell>
                    <TableCell sx={{ fontWeight: 'bold' }}>กิจกรรม</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {data.timesheets.map((t) => (
                    <TableRow key={t.id} hover>
                      <TableCell>{new Date(t.date).toLocaleDateString()}</TableCell>
                      <TableCell>
                        {new Date(t.checkInTime).toLocaleTimeString([], {
                          hour: '2-digit',
                          minute: '2-digit',
                        })}
                      </TableCell>
                      <TableCell>
                        {new Date(t.checkOutTime).toLocaleTimeString([], {
                          hour: '2-digit',
                          minute: '2-digit',
                        })}
                      </TableCell>
                      <TableCell sx={{ whiteSpace: 'pre-line' }}>{t.activity}</TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </Paper>
          )}
        </Box>
      </Box>
    </>
  );
}

export default StudentTimesheetView;
